import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Image, Container } from 'react-bootstrap';

const CarBrands = () => {
  return (
    <Container fluid className="d-flex align-items-center justify-content-between py-4">
      {/* Honda */}
      <div className="brand-logo">
        <Image 
          src="https://dashboard.codeparrot.ai/api/image/Z7ek8fEcbWrFn9sS/frame.png" 
          alt="Honda" 
          style={{ width: '272px', height: '67px' }}
          fluid
        />
      </div>

      {/* Jaguar */}
      <div className="brand-logo">
        <Image 
          src="https://dashboard.codeparrot.ai/api/image/Z7ek8fEcbWrFn9sS/frame-24.png" 
          alt="Jaguar"
          style={{ width: '224px', height: '67px' }}
          fluid
        />
      </div>

      {/* Nissan */}
      <div className="brand-logo">
        <Image 
          src="https://dashboard.codeparrot.ai/api/image/Z7ek8fEcbWrFn9sS/frame-25.png" 
          alt="Nissan"
          style={{ width: '79px', height: '67px' }}
          fluid
        />
      </div>

      {/* Volvo */}
      <div className="brand-logo bg-white">
        <Image 
          src="https://dashboard.codeparrot.ai/api/image/Z7ek8fEcbWrFn9sS/volvo-ca.png" 
          alt="Volvo"
          style={{ width: '224px', height: '17px', marginTop: '24px' }}
          fluid
        />
      </div>

      {/* Audi */}
      <div className="brand-logo">
        <Image 
          src="https://dashboard.codeparrot.ai/api/image/Z7ek8fEcbWrFn9sS/frame-27.png" 
          alt="Audi"
          style={{ width: '144px', height: '67px' }}
          fluid
        />
      </div>

      {/* Acura */}
      <div className="brand-logo">
        <Image 
          src="https://dashboard.codeparrot.ai/api/image/Z7ek8fEcbWrFn9sS/frame-28.png" 
          alt="Acura"
          style={{ width: '217px', height: '67px' }}
          fluid
        />
      </div>
    </Container>
  );
};

// Default props
CarBrands.defaultProps = {
  gap: 96, // Gap between logos as specified in the design
};

export default CarBrands;
